let liveConsoleSearchControlsUsed=customEvents
| where timestamp >= ago(7d)
| where name == 'ConsoleViewPanel.onPrevClick' or name == 'ConsoleViewPanel.onNextClick' or name == 'ConsoleViewPanel.onSearchTermCleared'
| where operation_Name contains "/container-perf.html" or operation_Name contains "multicluster-health.html"
| extend pageUrl = tostring(customDimensions.urlHint)
| extend pageBase = tostring(split(pageUrl, '?')[0])
//| where pageBase contains 'ininprodeusuxbase.' or pageBase contains 'afd.'
// cloud ops tip 1
//| where customDimensions.workspace_id !startswith '/subscriptions/692aea0b-2d89-4e7e-ae30-fffe40782ee2'
// Container Insights - Test - 1
| where customDimensions.workspace_id !startswith '/subscriptions/72c8e8ca-dc16-47dc-b65c-6b5875eb600a'
| extend action = iff(name == 'ConsoleViewPanel.onPrevClick', 'Previous', iff(name == 'ConsoleViewPanel.onNextClick', 'Next', iff(name == 'ConsoleViewPanel.onSearchTermCleared', 'Clear' , 'Unknown Action')))
| summarize dcount(user_Id) by bin(timestamp, 1d), action
| render timechart;
